query OrderFulfillData($orderId: ID!) {
  order(id: $orderId) {
    id
    lines {
      id
      isShippingRequired
      productName
      quantity
      allocations {
        quantity
        warehouse {
          id
          __typename
        }
        __typename
      }
      quantityFulfilled
      variant {
        id
        name
        sku
        attributes {
          values {
            id
            name
            __typename
          }
          __typename
        }
        stocks {
          id
          warehouse {
            id
            __typename
          }
          quantity
          quantityAllocated
          __typename
        }
        trackInventory
        __typename
      }
      thumbnail(size: 64) {
        url
        __typename
      }
      __typename
    }
    number
    __typename
  }
}
